import React from 'react'
import { LinearGradient } from 'expo-linear-gradient';
import {StyleSheet} from "react-native";

export const Shade = () => {
    return(
        <LinearGradient
            colors={['transparent',  'rgba(0,0,0,0.8)' ]}
            style={styles.background}
        />
    )
}

const styles = StyleSheet.create({
    background: {
        width: '100%',
        height: 300,
        position: 'absolute',
        bottom: 0,
        zIndex: 0
    }
})
